import React from "react";
import "./Projects.css";
import { Link, Router } from "react-router-dom";

const Projects = () => {
  return (
    <Router>
      <div>
        <div className="projectBody">
          <div className="project">
            <h3>Project Name:</h3>
            {/* <img>Preview IMG</img> */}
            <p>Brief Description</p>
            <Link to="https://samuel-torres.now.sh/">
              <button>CHECK PORTFOLIO</button>
            </Link>
          </div>
          <div className="project">
            <h3>Project Name:</h3>
            {/* <img>Preview IMG</img> */}
            <p>Brief Description</p>
            <button>Link To Project</button>
          </div>
          <div className="project">
            <h3>Project Name:</h3>
            {/* <img>Preview IMG</img> */}
            <p>Brief Description</p>
            <button>Link To Project</button>
          </div>
        </div>
      </div>
    </Router>
  );
};

export default Projects;
